import React from 'react';

class What extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            return (
                <div id="whatContainer">
                    <div id="whatImg">
                        
                    </div>

                    <div id="whatContent">
                        <strong><u>What we do:</u></strong><br />
                        This here is what we do. We will most likely have one or two sentences explaining our business.
                    </div>


                    <style jsx>
                        {`

                        #whatContainer {
                            height: 100%;
                            width: 200px;
                        }

                        #whatImg {
                            height: 200px;
                            width: 200px;
                            background-color: black;
                            margin: auto;
                            border-radius: 50%;
                        }

                        #whatContent {
                            color: white;
                            margin-top: 10px
                        }

                        @media (max-width: 720px) {

                            #whatContainer {
                                height: 100%;
                                width: 100%;
                            }
    
                            #whatImg {
                                height: 100%;
                                width: 100%;
                                background-color: black;
                                margin: auto;
                                border-radius: 0%;
                            }
    
                            #whatContent {
                                color: white;
                                top: 30%;
                                position: absolute;
                            }

                        }
                        
                        `}
                    </style>
                </div>
            )
        }
    }

export default What;
